import React from "react";
import { Form } from "react-bootstrap";

const FormForUpdatePost = ({
  editedUser,
  setEditedUser,
  setEditedTitle,
  editedTitle,
  editedBody,
  setEditedBody,
}) => {
  return (
    <Form>
      <Form.Group className="mb-3" controlId="formBasicUser">
        <Form.Label className="fw-bold fs-5">User</Form.Label>
        <Form.Control
          className="p-2"
          value={editedUser}
          onChange={(e) => setEditedUser(e.target.value)}
        />
      </Form.Group>
      <Form.Group className="mb-3" controlId="formBasicTitle">
        <Form.Label className="fw-bold fs-5">Title</Form.Label>
        <Form.Control
          className="p-2"
          value={editedTitle}
          onChange={(e) => setEditedTitle(e.target.value)}
        />
      </Form.Group>
      <Form.Group className="mb-3" controlId="formBasicBody">
        <Form.Label className="fw-bold fs-5">Description</Form.Label>
        <Form.Control
          className="p-2"
          as="textarea"
          value={editedBody}
          onChange={(e) => setEditedBody(e.target.value)}
        />
      </Form.Group>
    </Form>
  );
};

export default FormForUpdatePost;
